import './App.css';
import Navbar from './components/navbar/navbar';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Home from './pages/Home';
import Category from './pages/Category';
import ProductCataloge from './pages/ProductCataloge';
import ProductCart from './pages/ProductCart';
import LoginSignup from './pages/LoginSignup';
import Footer from './components/Footer/Footer';
import men_banner from './components/assests/banner_mens.png';
import women_banner from './components/assests/banner_women.png';
import kid_banner from './components/assests/banner_kids.png';

function App() {
  return (

    <BrowserRouter>
      <Navbar />
      <div>
        <Routes>
          <Route path='/' element={<Home />} />
          <Route path='/mens' element={<Category banner={men_banner} category="men" />} />
          <Route path='/womens' element={<Category banner={women_banner} category="women" />} />
          <Route path='/kids' element={<Category banner={kid_banner} category="kid" />} />
          <Route path='/product' element={<ProductCataloge />}>
            <Route path=':productId' element={<ProductCataloge />} />
          </Route>
          <Route path='/ProductCart' element={<ProductCart />} />
          <Route path='/Login' element={<LoginSignup />} />
        </Routes>
        <Footer />
         </div >
    </BrowserRouter>

  );
}

export default App;
